import React from 'react';
import {bool, func} from 'prop-types';
import ModalWithGradientTemplate from '../templates/ModalWithGradientTemplate';
import {ThanksTextOrganism} from '../organisms';

const ThanksModal = ({
  isFooterShow, 
  handleOpenThanksModal, 
  handleRedirectToPage
}) => {
  return(
    <ModalWithGradientTemplate 
      isFooterShow={isFooterShow} 
      handleOpenMenuModal={handleOpenThanksModal} 
      isThankYouModal={true}
    >
      <ThanksTextOrganism handleRedirectToPage={handleRedirectToPage}/>
    </ModalWithGradientTemplate>
  )
}

ThanksModal.propTypes = {
  handleRedirectToPage: func,
  handleOpenThanksModal: func,
  isFooterShow: bool,
}

export default ThanksModal;
